import Art from "./Art.png";

export const Baner = () => {
  return (
    <div className="flex border border-black rounded-[30px] py-5 px-7 mt-6">
      <div>
        <div>Страховая программе ЗАЩИТА +</div>
        <div>
          Одна из самых удобных и выгодных страховых программ предоставляемых
          грожанам России и иностранным гражданам. 
        </div>
        <button>купить</button>
      </div>
      <div>
        <img src={Art} />
      </div>
    </div>
  );
};
